import sys


class Solution:
    def addStrings(self, num1: str, num2: str) -> str:
        if len(num2) > 4300:
            new_num2 = int(num2[0]) * len(num2)
            return str(int(num1) + new_num2)
        elif len(num1) > 4300:
            new_num1 = int(num1[0]) * len(num1)
            return str(new_num1 + int(num2))
        else:
            return str(int(num2) + int(num1))


sol = Solution()
print(
    sol.addStrings(
        num1="1",
        num2="",
    )
)
